import React from 'react';

const getCar = () => {
    return { 
        brand: 'Ford',
        model: 'Mustang',
        type: 'car',
        year: 2021, 
        color: 'red',
        registration: {
            city: 'Houston',
            state: 'Texas',
            country: 'USA'
        }
    }
}

const Cars = () => {
    const {brand ,model ,type} = getCar();
    return (
        <p>My {type} Name Is </p>
    )
}

export default Cars;
